import React, { Component } from 'react';

import 'bootstrap/dist/css/bootstrap.min.css';




class PageCadastros extends Component {
  render() {
    return (

      <ul className="list-group">

        {pessoas.map(element => (
          <li className="list-group-item">{element.email + " " + element.senha}</li>
        ))}
      </ul>
    );

  }
}

export default PageCadastros;
